int _js_image_loader_js(struct mg_connection *conn)
{
    mg_send_header(conn, "Content-Type", "text/js");
    mg_send_header(conn, "Cache-Control", "public, max-age=604800");
    mg_printf_data(conn, "(function ($) {"
"    'use strict';"
""
"    $(function () {"
"        $('img').each(function () {"
"            var src = $(this).data('src');"
"            $.ajax({"
"                url: src,"
"                success: function (data) {"
"                    $(this).attr('src', 'data:image/png;base64,' + data);"
"                }"
"            });"
"        });"
"    });"
"}(window.jQuery));"
);
    return MG_TRUE;
}

